import React from "react";

const NewsItem = ({ title, news_url, text }) => {
    return (
        <div>
            <img src={news_url} alt="New Image" />
            <h3>
                <a>{title}</a>
            </h3>
            <p>{text}</p>
        </div>
    );
};

export default NewsItem;
